import { Link } from "react";

function Signup() {
  return (
    <div class="container container__">
      <span class="navbar-brand navbar__brand">Mini Urls</span>
      <input type="checkbox" name="checkbox" id="menu" />
      <button className="navbar-toggler">
        <label htmlFor="menu">
          <span class="navbar-toggler-icon"></span>
        </label>
      </button>
      <div class="collapse navbar-collapse" id="menu-content">
        <ul class="navbar-nav navbar__nav">
          <li class="nav-item nav__item">Features</li>
          <li class="nav-item nav__item">Sign in</li>
        </ul>
      </div>
    </div>
  );
}

export default Signup;
